def generateDirectLinks(inputStr, outputPath):
    linkL = inputStr.split(", ")

    # remove junk
    revisedLinkL = [re.sub('https://drive.google.com/file/d/', '', link) for link in linkL]
    revisedLinkL = [link.split('/view?usp=sharing')[0] for link in revisedLinkL]

    # add the neceessary prefix
    print(revisedLinkL)
    finalLinkL = ['https://drive.google.com/uc?id='+ link for link in revisedLinkL]
    ids = []
    counter = 1
    for id in finalLinkL:
        ids.append(str(counter))
        counter+=1
    print(finalLinkL)

    # output to csv
    df = pandas.DataFrame(data={"id": ids, "image_url": finalLinkL})
    df.to_csv("./"+outputPath, sep='\t',index=False)
    return

